def file_sync(request):
    if request.method == "POST":

        result = 0
        # try:
        megs = json.loads(request.body)
        megs_list = eval(megs)

        for meg in megs_list:
            action = meg['action']
            md5 = meg['md5']
            filename = meg['filename']
            file_path = meg['filepath']
            file_size = meg['file_size']
            backup_date = meg['backup_date']
            backup_time = meg['arrive_time']
            ctime = meg['ctime']
            mtime = meg['mtime']
            atime = meg['atime']

            calendar = Calendar.get_obj(backup_date)
            calendar_id = calendar.id

            app = App.get_obj(app_name="ebank")
            app_id = app.id

            if action == 'i':
                result = 1
                bkfile = BackupFile(md5 = md5, name = filename, path = file_path, size = file_size, mtime = mtime, ctime = ctime,
                                        atime = atime, backup_date_id = calendar_id, app_id = app_id, backup_time = backup_time)
                bkfile.save()
            elif action == 'u':
                result = 2
                bkfile = BackupFile.get_obj(path=file_path, filename=filename)
                bkfile.update_obj(size=file_size,
                                  mtime=mtime,
                                  ctime=ctime,
                                  atime=atime,
                                  md5=md5,
                                  app_id=app_id,
                                  backup_date_id=calendar_id,
                                  backup_time=backup_time)
            elif action == 'd':
                pass
            else:
                result = "Action not found!"

        # except Exception, e:
        #     return HttpResponse("-2")
        # finally:
        return HttpResponse(result)





